import React from 'react';
import Moment from 'react-moment';

import '../../styles/components/weather/_forecast.scss';

export default function WeeklyForecast({ forecast, toggleForecast }) {
	// console.log('forecast', forecast)
	return (
		<React.Fragment>
			<h4 className='title-block light clickable' onClick={toggleForecast}><span>Weekly Forecast</span></h4>
			<div className='forecast-list'>
				{
					forecast.map((timeframe) => (

						<div key={timeframe.dt} className='forecast'>
							<span className='forecast-time'><Moment format="ddd">{timeframe.dt_txt}</Moment></span>
							<div className='forecast-info'>
								<span className='temperature'>{ Math.round(timeframe.main.temp) }</span>
							</div>
						</div>
					))
				}
			</div>
		</React.Fragment>
	)
}
